import { Container, ListGroup, } from 'react-bootstrap';
import StarBorderIcon from '@mui/icons-material/StarBorder';
import ReactPaginate from 'react-paginate';

const ResponsePagination = (props) => {

    const handlePageClick = (data) => {
        console.log(data.selected)
    }

    return (
        <Container>
            <ReactPaginate className=''
            pageCount={3}
            onPageChange={handlePageClick}
            containerClassName={'pagination'}
            pageClassName={'page-item'}
            pageLinkClassName={'page-link_custom'}

            />
            <ListGroup as="ul">
                {props.data.map((el) => (
                        <ListGroup.Item key={el.id} as="li" className='d-flex justify-content-between'><div>{el.name}</div> <div><StarBorderIcon /></div></ListGroup.Item>
                ))}</ListGroup>
        </Container>

    );
};

export default ResponsePagination;
